create sequence dbo.seq_country
    start with 100;

alter sequence dbo.seq_country owner to gesco;


create table dbo.country
(
    id                bigint default nextval('dbo.seq_country'::regclass) not null
        constraint country_pk
            primary key,
    code              varchar(20),
    alphabetic_code_2 varchar(2),
    alphabetic_code_3 varchar(3),
    name              varchar(100),
    created_at        timestamp,
    updated_at        timestamp,
    created_by        bigint,
    updated_by        bigint,
    id_state          integer
);

alter table dbo.country
    owner to gesco;


